import { Children } from "react"
import "./index.css"
function Navbar(){
    const path = window.location.pathname

    return(
        <div id="navbar">
            <div className="navele"> <a href="/">Home</a> </div>
            <div className="navele"> <a href="/about">About</a> </div>
        </div>
    )
}

function CustomLink({href}){
    return(
        <div className="navele"> <a href={href}>{Children}</a> </div>
    )
}

export default Navbar
